const LOADING = "LOADING";
const ERROR = "ERROR";
const SUCCESS = "SUCCESS";
const GET = "GET";
const POST = "POST";
const UPDATE = "UPDATE";
const DELETE = "DELETE";
const SET_SELECTED_POST = "SET_SELECTED_POST";
const LOGIN = "LOGIN";
const LOGOUT = "LOGOUT";
const LIKE = "LIKE";

const actionTypes = {
  LOADING,
  ERROR,
  SUCCESS,
  GET,
  POST,
  UPDATE,
  DELETE,
  SET_SELECTED_POST,
  LOGIN,
  LOGOUT,
  LIKE,
};

export default actionTypes;
